<?php
	/*	
	*	Goodlayers Master Slider Support File
	*/
	
	// disable auto update
	add_filter( 'masterslider_disable_auto_update', '__return_true' );
	
	// add a new section to starter sections
	add_filter( 'masterslider_starter_sections', 'limoking_add_ms_section' );	
	if( !function_exists('limoking_add_ms_section') ){
		function limoking_add_ms_section( $sections ){
		 
			array_unshift($sections, array(
				'id'    => 'limoking_ms_starter',  // you should define unique id for each section
				'title' => esc_html__('Goodlayers Starter', 'limoking'),   // a title for starter section
			));

			return $sections;
		}
	}
	
	add_filter( 'masterslider_starter_fields', 'limoking_add_ms_slider' );
	if( !function_exists('limoking_add_ms_slider') ){
		function limoking_add_ms_slider( $starters ){
			$starters['limoking_ms_starter'] = array(
				array(
					'label'     => esc_html__( 'Sample Slider', 'limoking' ),
					'id'        => 'limoking-sample-slider1',
					'slidertype'=> 'custom',
					'importdata'=> '',
					'screenshot'=> get_template_directory_uri() . '/images/sample-slider.png',
					'selected' => false
				), 
				array(
					'label'     => esc_html__( 'Sample Slider Yellow', 'limoking' ),
					'id'        => 'limoking-sample-slider1',
					'slidertype'=> 'custom',
					'importdata'=> '',
					'screenshot'=> get_template_directory_uri() . '/images/sample-slider.png',
					'selected' => false
				)
			);
			
			return $starters;
		}
	}
    	
	
	
	// page item section
	if(!function_exists('limoking_get_masterslider_list')){
		function limoking_get_masterslider_list(){
			if( !function_exists('get_masterslider_names') ) return;
		
			return get_masterslider_names(true);
		}
	}
	
	add_action('limoking_print_item_selector', 'limoking_check_masterslider_item', 10, 2);
	if( !function_exists('limoking_check_masterslider_item') ){
		function limoking_check_masterslider_item( $type, $settings = array() ){
			if( !function_exists('get_masterslider') ) return;
		
			$item_id = empty($settings['page-item-id'])? '': ' id="' . $settings['page-item-id'] . '" ';

			global $limoking_spaces;
			$margin = (!empty($settings['margin-bottom']) && 
				$settings['margin-bottom'] != $limoking_spaces['bottom-item'])? 'margin-bottom: ' . $settings['margin-bottom'] . ';': '';
			$margin_style = (!empty($margin))? ' style="' . $margin . '" ': '';	
		
			if($type == 'master-slider'){
				echo '<div class="limoking-master-slider-item limoking-slider-item limoking-item" ' . $item_id . $margin_style . ' >';
				echo get_masterslider($settings['id']);
				echo '</div>';
			}
		}
	}	
	
?>